/* FOOTER - INDEX.JS */

import React from 'react';
import './style.css'

export default function Footer() {
    return(
        <footer className="footer">
            <p className ="footer-contact-text">Realized by <a className ="footer-contact-link" href="https://github.com/SYB-SFLA">Sophie BAYRAM</a> <a className ="footer" href="https://videomenthe.fr/saas-eolementhe.html"></a> for Eolemente </p>
        </footer>
    )
}
